import React, { Fragment, useState } from "react";
import { Link } from "react-router-dom";

const HomePolicyDashBoard = () => {
  return (
    <Fragment>
      <Link to="/policy" className="btn btn-danger mb-2">
        Back To Policy DashBoard
      </Link>
      <div className="row">
        <div className="col-6">
          <div className="h6 list-group-item list-group-item-primary text-center">
            List of Home Properties on This Policy
          </div>
        </div>

        <div className="col-6 align-items-end">
          <ul className="list-group">
            <li className="list-group-item list-group-item-warning h6 text-center">
              All Invoices
            </li>
            // insert invoice card here
          </ul>
        </div>
      </div>
    </Fragment>
  );
};

export default HomePolicyDashBoard;
